description:
A flexible messenger that integrates with email and lets you store and share files easily.

In Fleep you can:
* easily create conversations with your teams, consisting of any combination of people from within and outside the organization;
* add people to conversations and teams with their email address - and they will receive messages as emails until they sign up to Fleep;
* always see who is participating in the conversation and how far they have read the messages;
* easily share files of any size;
* access all your conversations and files on any device - all in sync and securely stored in Fleep‚Äôs cloud;
* edit sent messages to make corrections;
* create, assign and manage tasks;
* easily search across conversations to find the information you need.
